import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class LccLinkTile extends React.Component {
  render() {
    const newTo = {
      pathname: this.props.to,
      param1: "Par1"
    };
    return (
      <Link to={newTo} >
        <h3>{this.props.header}</h3>
        <p>{this.props.description}</p>
      </Link>
    );
  }
}
